function Coin(props){
    const {item}=props.item
    return(
        <tr>
            <td>{coin.name}</td>
            <td>{coin.symbol}</td>
            <td>{'$ '+(coin.current_price).toLocaleString('en-US')}</td>
            <td>{Number(coin.price_change_percentage_24h).toFixed(2).toString()+" %"}</td>
            <td>{'$ '+(coin.market_cap).toLocaleString('en-US')}</td>
        </tr>
    )
}
export default Coin
